type: object
required:
  - code
  - name
  - type
  - entity_id
  - license_enabled
properties:
  code:
    type: string
    description: Can't contain whitespaces. If type is <code>ACCESS_CONTROL</code>, code must be a number less than 2147483647
  name:
    type: string
  type:
    type: string
    enum:
      - BOX_OFFICE
      - ACCESS_CONTROL
      - INTEGRATION
  entity_id:
    type: integer
  license_enabled:
    type: boolean